import Header from "../components/header";
import Main from "../components/main";
import Article from "../components/article";
import Section from "../components/section";
import Footer from "../components/footer";

const Home = () => {
  return (
    <>
      {/* start header with image background */}
      <Header />
      {/* this line the header of page ends  */}
      {/* start main  */}
      <Main />
      {/* end main  */}
      {/* start article */}
      <Article />
      {/* end article */}
      {/* start section */}
      <Section />
      {/* end section */}
      {/* start footer */}
      <Footer />
      {/* end footer */}
    </>
  );
};
export default Home;
